import React from 'react';
import styled from 'styled-components';
import { BlotterText } from './BlotterText';

const FooterSection = styled.footer`
  width: 100%;
  padding: 4rem 2rem 2rem;
  background: var(--background);
  position: relative;
`;

const FooterContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 2fr 1fr 1fr;
  gap: 4rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
    gap: 2rem;
  }
`;

const BrandSection = styled.div`
  margin-bottom: 2rem;
`;

const BrandTitle = styled.div`
  margin-bottom: 1rem;
`;

const BrandDescription = styled.p`
  color: rgba(255, 255, 255, 0.7);
  line-height: 1.6;
  margin-bottom: 2rem;
`;

const NavSection = styled.div``;

const NavTitle = styled.div`
  margin-bottom: 1.5rem;
`;

const NavList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
`;

const NavItem = styled.li`
  margin-bottom: 1rem;
`;

const NavLink = styled.a`
  color: rgba(255, 255, 255, 0.7);
  text-decoration: none;
  transition: color 0.3s ease;
  display: inline-block;

  &:hover {
    color: var(--accent);
  }
`;

const SocialSection = styled.div``;

const TelegramButton = styled.a`
  display: inline-flex;
  align-items: center;
  padding: 0.8rem 1.5rem;
  font-size: 1rem;
  border: 2px solid var(--accent);
  border-radius: 8px;
  color: var(--accent);
  text-decoration: none;
  transition: all 0.3s ease;
  margin-top: 1rem;

  &:hover {
    background: var(--accent);
    color: var(--background);
    transform: translateY(-2px);
  }

  &::before {
    content: 'ðŸ“±';
    margin-right: 0.5rem;
  }
`;

const Divider = styled.hr`
  border: none;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  margin: 3rem 0;
`;

const BottomBar = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  color: rgba(255, 255, 255, 0.5);
  font-size: 0.9rem;

  @media (max-width: 768px) {
    flex-direction: column;
    text-align: center;
    gap: 1rem;
  }
`;

const Copyright = styled.div``;

const DisclaimerText = styled.div`
  max-width: 500px;
  text-align: right;

  @media (max-width: 768px) {
    text-align: center;
  }
`;

export const Footer: React.FC = () => {
  return (
    <FooterSection>
      <FooterContent>
        <BrandSection>
          <BrandTitle>
            <BlotterText 
              text="SQUANCH"
              fill="rgba(255, 255, 255, 0.9)"
            />
          </BrandTitle>
          <BrandDescription>
            Welcome to the Squanchiverse, where memes meet AI in an interdimensional adventure!
          </BrandDescription>
          <TelegramButton 
            href="https://t.me/SquanchCoin" 
            target="_blank" 
            rel="noopener noreferrer"
          >
            Join Our Community
          </TelegramButton>
        </BrandSection>

        <NavSection>
          <NavTitle>
            <BlotterText 
              text="Navigation"
              fill="rgba(255, 255, 255, 0.9)"
            />
          </NavTitle>
          <NavList>
            <NavItem><NavLink href="#features">Features</NavLink></NavItem>
            <NavItem><NavLink href="#token">Token</NavLink></NavItem>
            <NavItem><NavLink href="#demo">Demo</NavLink></NavItem>
            <NavItem><NavLink href="#community">Community</NavLink></NavItem>
            <NavItem><NavLink href="#roadmap">Roadmap</NavLink></NavItem>
          </NavList>
        </NavSection>

        <SocialSection>
          <NavTitle>
            <BlotterText 
              text="Connect"
              fill="rgba(255, 255, 255, 0.9)"
            />
          </NavTitle>
          <NavList>
            <NavItem>
              <NavLink 
                href="https://t.me/SquanchCoin" 
                target="_blank" 
                rel="noopener noreferrer"
              >
                Telegram
              </NavLink>
            </NavItem>
          </NavList>
        </SocialSection>
      </FooterContent>

      <Divider />

      <BottomBar>
        <Copyright>Â© 2024 Squanchiverse. All rights reserved.</Copyright>
        <DisclaimerText>
          $SQUANCH is a meme coin for entertainment. DYOR and invest responsibly.
        </DisclaimerText>
      </BottomBar>
    </FooterSection>
  );
};
